import React from "react";

const MatchedImages = ({ matchedImages, uploadedSelfie }) => {
  return (
    <div>
      <h2>Matched Event Images</h2>
      <div style={{ display: "flex", flexWrap: "wrap" }}>
        {matchedImages.map((image, index) => (
          <div key={index} style={{ margin: "10px" }}>
            <img
              src={`http://localhost:5000/api/images/${encodeURIComponent(
                image
              )}`}
              alt={`Uploaded selfie: ${uploadedSelfie}`}
              style={{
                width: "150px",
                height: "150px",
                objectFit: "cover",
              }}
            />
            <p>{image}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default MatchedImages;
